        function output() {
            console.log(this.state.code)
        };

        return(
            <div>
                <div className="navigation flex">
                    <img src="https://via.placeholder.com/150x60.png" alt="" className="logo" />
                    <div className="w-96 flex-1"></div>
                    <button className="" onClick={output}>Run</button>
                </div>
                <div className="body-div flex">
                    <textarea placeholder="Enter your code here." className="w-96 h-96 border-2 border-black m-auto" value={this.state.code} id="text-editor" onChange={this.setState({"code": target.value})} >

                    </textarea>
                    <div className="w-96 h-96 border-2 border-black m-auto">
                        Console
                    </div>
                </div>
            </div>
        )
    }
}

export default Main
